import { lazy } from "react";

const Home = lazy(() => import("./Home"));
const ProductDetails = lazy(() => import("./ProductDetails"));
const homeRoutes = [
  {
    path: "/home",
    component: Home,
  },
  {
    path: "/product/details/:id",
    component: ProductDetails,
  },
];

export default homeRoutes;
